{"author":"108153479830241280","channel":"408576171886903296","content":"**Let me answer the first part of the argument first - how is it that it is impossible to determine that humanity cannot last forever.**

Some think that humanity will not last forever because of a perceived filter up ahead. Basing off empirical data, that, say, the dinosaurs were wiped out because of a catastrophic event, and so on. However, did you know that the biological class Aves, or birds, are evolutionary descendants of dinosaurs? If you take this into consideration, dinosaurs are technically still roaming the earth today.

There has been plenty of mass extinction events in Earths history, however, life has still survived, prospered even. Humanitys origins are very likely bacterial lifeforms. None of these extinction events have managed to wipe these bacterial lifeforms out, neither have they managed to wipe humanitys multicellular ancestors out either. This is not to say, however, that there would not be an extinction event in future that would do so - gamma ray bursts and other unpredictable events are always possible.","server":"381467097030459393"}

{"author":"108153479830241280","channel":"408576171886903296","content":"However, can you predict such events? You cannot, not with current technology. Thus, you do not have any information whatsoever to prove that a mentioned event like such would happen. It would be equivalent to saying that the rain tomorrow would cause an entire city to be submerged today because it caused flash floods yesterday.

The above argument is fallacious to say the least, and so is the idea that humanity would not last forever. It is not common sense that humans would never last. These are generalisations brought on by empirical data, some of which have been presented above which could lead to such generalisations. Just because a forest fire wiped out half of a jungle last year does not mean that a forest fire definitely has the capability to wipe out the entire jungle this year or the following years. One simply does not have any record of a historical event which has caused complete destruction that can be used in this context. To claim that it is common sense would be appealing to popular belief, appealing to probability, a modal fallacy and disproving otherwise would be appealing to incredulity.

Another argument here that can be pointed out is that the universe is undergoing entropy, that there is some scientific proof that the universe would eventually die out. However, what is there to say that humanity cannot provide technology which would enable it to bypass such an obstacle either? There is no information.","server":"381467097030459393"}

{"author":"108153479830241280","channel":"408576171886903296","content":"**Notwithstanding which, let me now explain how it is impossible to prove that humanity will last forever either.**

With empirical information, it is possible to derive that given sufficient resources, life will flourish for as long as it has lasted here. For the sake of discussion, lets suppose that with the same environment and supposedly unlimited resources life would continue flourishing, and even thrive. However, how long can such resources last? By resources I do not mean the resources found only on earth. In introspect, consider the possible amount of resources that are out there in the universe.

Is the universe infinite? Does it have infinite resources? More importantly, can we reach these resources? We have no answers to these either, neither can we intelligently predict so. Hence, to claim that humanity would last forever would be to assume that such resources are infinite and within humanitys grasp. This would be fallacious and unsupported by relevant facts.","server":"381467097030459393"}

{"author":"108153479830241280","channel":"408576171886903296","content":"As mentioned before, it is impossible, with current technology, to predict all the possible catastrophic events that could happen either. Some could claim that there is a possibility of an unimaginable event which would completely devastate and eradicate humanity, but they would have no proof. Those that say that the possibility of such an event happening is null would have no proof either.

Another possible argument is that humanity will last forever because technology will continue expanding and eventually humanity will find a way out of this seemingly endless cycle. This is again unsupported by facts.

**To conclude,** Einstein once said, the more I learn, the more I realise how much I dont know. We simply do not have sufficient information to know the answers to this question. To base it off empirical data would be irrelevant and uncontextualised.","server":"381467097030459393"}
